import { Avatar } from '@mui/material';
import { Box } from '@mui/system';
import React, {UseState}from 'react';
import NavbarSeller from './navbarSeller';
const MyProfile = () => {
    return ( <>
     <NavbarSeller/>
     <Box sx={{
        positon:"absolute",
        top:"100px",
        width:"100%",
        height:"150px",
        backgroundColor:"gray"
     }}>
     </Box>
     <Avatar sx={{
            position:"absolute",
            left:"45%",
            width:"100px",
            top:"110px",
            height:"100px"
        }}></Avatar>
    <Box sx={{
        position:"absolute",
        top:"30%",
        left:"10%",
        width:"80%",
        backgroundColor:"pink",
        height:"60%"

    }}>

    </Box>
    </> 
    );
}

export default MyProfile;
